import { Card, CardContent, Container, Grid, Paper } from '@material-ui/core'
import React from 'react'

import imag4 from '../resurces/imag4.png'

export function ListCards({ card }) {
  return (
    <>
      <Container>
        <Grid Container>
          {card.map((e, i) => (
            <Grid item key={i} sx={{ m: 5 }}>
              <Paper>{e.title}</Paper>
            </Grid>
          ))}
        </Grid>
      </Container>
    </>
  )
}
